import React from "react";
import {
  TextField,
  Button,
  Typography,
  makeStyles,
  Container,
  CssBaseline,
} from "@material-ui/core";

const useStyles = makeStyles(theme =>({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  mainElement: {
    fontWeight: "500",
    fontFamily: "Ma Shan Zheng",
    color: "#424242"
  }
}));

const LoginBox = () => {
  const classes = useStyles();
  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
        <Typography className={classes.mainElement} variant="h2">
          Goal
        </Typography>
        <Typography className={classes.mainElement} variant="h1">
          Book
        </Typography>
        <form  noValidate autoComplete="off">
          <TextField id="standard-basic" label="Email" />
        </form>
        <form
          fullWidth
          noValidate
          autoComplete="off"
        >
          <TextField id="standard-basic" label="Password" />
        </form>
        <Button
          style={{ paddingLeft: 24, paddingRight: 24 }}
          color="primary"
          variant="contained"
          fullWidth
        >
          Login
        </Button>
        <Button
          style={{ marginLeft: 12, paddingLeft: 24, paddingRight: 16 }}
          color="secondary"
          variant="outlined"
        >
          Sign up
        </Button>
      </div>
    </Container>
  );
};

export default LoginBox;
